ntionedJid[0] // Se in gruppo, prende l'utente menzionato","    else who = m.chat // Se in privato, usa l'utente corrente","    ","    if (!who) throw '🚩 Devi menzionare un utente con *@user*'","    ","    let txt = text.replace('@' + who.split`@`[0], '').trim()","    if (!txt) throw '🚩 Inserisci la quantità di *💶 Unitycoins* da trasferire'","    if (isNaN(txt)) throw 'Solo numeri sono accettati'","    ","    let Unitycoins = parseInt(txt)","    let costo = Unitycoins","    let tassaImporto = Math.ceil(Unitycoins * tassa)","    costo += tassaImporto","    ","    if (costo \u003c 1) throw '🚩 Il minimo trasferibile è *1 💶 Uniticoin*'","    ","    let users = global.db.data.users","    if (costo \u003e users[m.sender].limit) throw 'Non hai abbastanza *💶 Unitycoins* per questo trasferimento'","    ","    // Esegui la transazione","    users[m.sender].limit -= costo","    users[who].limit += Unitycoins","    ","    await m.reply(`*${-Unitycoins}* 💶 Unitycoins ","Tassa 2% : *${-tassaImporto}* 💶 Unitycoins","Totale addebitato: *${-costo}* 💶 Unitycoins`)","    ","    // Notifica il destinatario","    conn.fakeReply(m.chat, `*+${Unitycoins}* 💶 Unitycoins ricevute!`, who, m.text)","}","","handler.help = ['daiUnitycoins *@user \u003cquantità\u003e*']","handler.tags = ['rpg']","handler.command = ['daiUnitycoins', 'bonifico', 'trasferisci','dona']","handler.register = true ","","export default handler"],"stylingDirectives":[[[0,6,"pl-k"],[7,18,"pl-v"],[19,23,"pl-k"],[24,49,"pl-s"]],[],[[0,3,"pl-k"],[4,9,"pl-s1"],[10,11,"pl-c1"],[12,16,"pl-c1"],[17,49,"pl-c"]],[],[[0,3,"pl-k"],[4,11,"pl-en"],[12,13,"pl-c1"],[14,19,"pl-k"],[20,21,"pl-kos"],[21,22,"pl-s1"],[22,23,"pl-kos"],[24,25,"pl-kos"],[30,31,"pl-kos"],[37,38,"pl-kos"],[38,39,"pl-kos"],[40,42,"pl-c1"],[43,44,"pl-kos"]],[[4,7,"pl-k"],[8,11,"pl-s1"]],[[4,6,"pl-k"],[7,8,"pl-kos"],[8,9,"pl-s1"],[9,10,"pl-kos"],[10,17,"pl-c1"],[17,18,"pl-kos"],[19,22,"pl-s1"],[23,24,"pl-c1"],[25,26,"pl-s1"],[26,27,"pl-kos"],[27,39,"pl-c1"],[39,40,"p